import React from "react";
import styles from "./styles.css";
import logo from "./img/tiendaLogo.png";

const Header = () => {

    return (
        <header>
            <img src={logo} alt="Logo" className={styles.logo} />
            <h1>Mi Tiendita OnLine</h1>
                <nav>
                    <p>Inicio</p>
                    <p>Ofertas</p>
                    <p>Nosotros</p>
                    <p>Ayuda</p>
                </nav>
        </header>
    )
}

export default Header;
